                    placeholder="-1 for unlimited"
                  />
                </div>
                <div>
                  <label className="block text-sm font-medium text-black mb-1">Max Images per Property</label>
                  <input
                    type="number"
                    name="max_images_per_property"
                    value={planForm.max_images_per_property}
                    onChange={handleInputChange}
                    className="w-full border-2 border-black rounded-lg px-3 py-2 focus:outline-none focus:ring-2 focus:ring-gray-500"
