                      name="priority_support"
                      checked={planForm.priority_support}
                      onChange={handleInputChange}
                      className="mr-2"
                    />
                    <span className="text-black">Priority Support</span>
                  </label>
                  <label className="flex items-center">
                    <input
                      type="checkbox"
                      name="api_access"
