                    <span className="text-black">API Access</span>
                  </label>
                  <label className="flex items-center">
                    <input
                      type="checkbox"
                      name="custom_branding"
                      checked={planForm.custom_branding}
                      onChange={handleInputChange}
                      className="mr-2"
                    />
                    <span className="text-black">Custom Branding</span>
                  </label>
                  <label className="flex items-center">
                    <input
                      type="checkbox"
                      name="advanced_reporting"
                      checked={planForm.advanced_reporting}
                      onChange={handleInputChange}
                      className="mr-2"
                    />
                    <span className="text-black">Advanced Reporting</span>
                  </label>
                  <label className="flex items-center">
                    <input
                      type="checkbox"
