                <div>
                  <label className="block text-sm font-medium text-black mb-1">Setup Fee (â‚±)</label>
                  <input
                    type="number"
                    name="setup_fee"
                    value={planForm.setup_fee}
                    onChange={handleInputChange}
                    step="0.01"
                    className="w-full border-2 border-black rounded-lg px-3 py-2 focus:outline-none focus:ring-2 focus:ring-gray-500"
                  />
                </div>
                <div>
                  <label className="block text-sm font-medium text-black mb-1">Max Properties</label>
                  <input
                    type="number"
                    name="max_properties"
                    value={planForm.max_properties}
                    onChange={handleInputChange}
                    className="w-full border-2 border-black rounded-lg px-3 py-2 focus:outline-none focus:ring-2 focus:ring-gray-500"
                    placeholder="-1 for unlimited"
                  />
                </div>
                <div>
                  <label className="block text-sm font-medium text-black mb-1">Max Images per Property</label>
                  <input
                    type="number"
                    name="max_images_per_property"
                    value={planForm.max_images_per_property}
                    onChange={handleInputChange}
                    className="w-full border-2 border-black rounded-lg px-3 py-2 focus:outline-none focus:ring-2 focus:ring-gray-500"
                  />
                </div>
                <div>
                  <label className="block text-sm font-medium text-black mb-1">Trial Days</label>
                  <input
                    type="number"
                    name="trial_days"
                    value={planForm.trial_days}
                    onChange={handleInputChange}
                    className="w-full border-2 border-black rounded-lg px-3 py-2 focus:outline-none focus:ring-2 focus:ring-gray-500"
                  />
                </div>
                <div>
                  <label className="block text-sm font-medium text-black mb-1">Sort Order</label>
                  <input
                    type="number"
                    name="sort_order"
                    value={planForm.sort_order}
                    onChange={handleInputChange}
                    className="w-full border-2 border-black rounded-lg px-3 py-2 focus:outline-none focus:ring-2 focus:ring-gray-500"
                  />
                </div>
              </div>
              
              <div className="mt-6">
                <h3 className="text-lg font-semibold text-black mb-4">Status</h3>
                <div className="flex items-center space-x-4">
                  <label className="flex items-center">
                    <input
                      type="checkbox"
                      name="is_active"
                      checked={planForm.is_active}
                      onChange={handleInputChange}
                      className="mr-2"
                    />
                    <span className="text-black">Active Plan</span>
                  </label>
                  <label className="flex items-center">
                    <input
                      type="checkbox"
                      name="is_featured"
                      checked={planForm.is_featured}
                      onChange={handleInputChange}
                      className="mr-2"
                    />
                    <span className="text-black">Featured Plan</span>
                  </label>
                </div>
              </div>
              
              <div className="flex justify-end space-x-3 mt-6 pt-4 border-t-2 border-black">
                <button
                  type="button"
                  onClick={() => { setShowEditModal(false); resetForm(); }}
                  className="px-4 py-2 border-2 border-black text-black rounded-lg hover:bg-gray-100 transition-colors"
                >
                  Cancel
                </button>
                <button
                  type="submit"
                  disabled={loading}
                  className="px-4 py-2 bg-black text-white rounded-lg hover:bg-gray-800 transition-colors disabled:opacity-50"
                >
                  {loading ? 'Updating...' : 'Update Plan'}
                </button>
              </div>
            </form>
          </div>
        </div>
      )}

      {/* Manage Features Modal */}
      {showFeaturesModal && (
        <div className="fixed inset-0 bg-black bg-opacity-50 flex items-center justify-center z-50">
          <div className="bg-white rounded-xl shadow-xl max-w-lg w-full mx-4">
